const Skill = ({ title, skills }) => {
  return (
    <div className="resume-skill-item">
      <h4 className="resume-skills-cat font-weight-bold">{title}</h4>
      <ul className="list-unstyled mb-4">
        <li className="mb-2">
          <div className="resume-skill-name">{skills.language}</div>
          <div className="progress resume-progress">
            <div
              className="progress-bar theme-progress-bar-dark"
              role="progressbar"
              style={{ width: skills.language.percentaje }}
              aria-valuenow="25"
              aria-valuemin="0"
              aria-valuemax="100"
            ></div>
          </div>
        </li>
      </ul>
    </div>
  );
};

export default Skill;
